import { useEffect, useState } from 'react';
import s from './NewsList.module.css';

const NewsList = ({ data }) => {
	let [news, setNews] = useState([]);

	useEffect(() => {
		setNews(data);
	}, [data]);

	useEffect(() => {
		if (news.length > 0) {
			console.log(data);
		}
	}, [news]);

	return <div>NewsList</div>;
};

export default NewsList;
